        if n in memo:
            return memo[n]
        if n == 1:
            return 3
        if n % 2 == 0:
            result = 1 + n // 2
        else:
            result = helper(n - 1, memo) + helper(n - 2, memo) + helper(n + 1, memo)
        memo[n] = result
        return result

    memo = {}
    result = [helper(i, memo) for i in range(1, n + 2)]
    return result

